import React, { Component } from 'react';
import { Route, Switch } from 'react-router-dom';
import { spring, AnimatedRoute } from 'react-router-transition';
import Pocetna from './pages/Pocetna/Pocetna';
import NoMatch from './pages/NoMatch/NoMatch';
import Kontakt from './pages/Kontakt/Kontakt';

export default class App extends Component {
	render() {
		return (
			<React.Fragment>
				<AnimatedSwitch
					atEnter={bounceTransition.atEnter}
					atLeave={bounceTransition.atLeave}
					atActive={bounceTransition.atActive}
					mapStyles={mapStyles}
					className="route-wrapper"
				>
					<AnimatedRoute exact path="/" component={Pocetna} />
					<AnimatedRoute path="/kontakt" component={Kontakt} />
					<AnimatedRoute component={NoMatch} />
				</AnimatedSwitch>
			</React.Fragment>
		);
	}
}
